import '../../styles/Main.css';
import Primise from './Primise';
import MyRentalInfo from './MyRentalInfo';
import axios from 'axios';
import { useEffect } from 'react';

function PrimiseList() {
    const [products, setProducts] = useState([]);

    useEffect(() => {
        // Функция для загрузки данных с сервера
        const fetchData = async () => {
        try {
            const response = await axios.get('http://example.com/api/products');
            setProducts(response.data); // Установка загруженных данных в состояние
        } catch (error) {
            console.error('Ошибка загрузки данных:', error);
        }
        };

        // Загрузка данных с сервера при монтировании компонента
        fetchData();
    }, []);

	return (
        <div className="primesController">
            <MyRentalInfo/>
            <div className="primiseList">
                <Primise/>
                <Primise/>
                <Primise/>
                <Primise/>
                <Primise/>
                <Primise/>
                <Primise/>
                <Primise/>
                <Primise/>  
            </div>
        </div>
  	);
}

export default PrimiseList;
